pug_html = pug_html + "\u003Cp\u003E \u003Cb\u003EData management \u003C\u002Fb\u003Esidebar contains options regarding loading or acquistion of the Human AGEs web server input data. \u003C\u002Fp\u003E\u003Cp\u003EFirst section is the \u003Cb\u003ESession management\u003C\u002Fb\u003E. Session is a powerful utility that can save or restore entire interactive map state using session file. At any time, user can use provided options to save the visualization and download it for the backup or sharing. Additionally, there is an option to load a predefined session. It may serve as a start point of the user's own work.\u003C\u002Fp\u003E\u003Cp\u003ESecond section is the \u003Cb\u003EUser dataset\u003C\u002Fb\u003E. It contains an option to load custom user dataset from the local hard drive. The acceptable dataset file formats are JSON and CSV. The mandatory attributes of the samples are: sample_id, latitude, longitude. Any other provided attribute is possible to visualize using map layers. These include genomic, anthropological or archeological attributes, that can be represented as either non-unique text (e.g. haplogroups; sex; development stage; burial type), vector of comma-separated frequencies summing up to 1 (e.g. 0.25,0.25,0.5) or 2D vector of cartesian real number coordinates (e.g. 4.56,10.1).\nWe prepared two example files which can be a basis of either \u003Ca href=\"\u002Fdata\u002Fexample_dataset.json\" download=\"\"\u003EJSON dataset file \u003C\u002Fa\u003Eor \u003Ca href=\"\u002Fdata\u002Fexample_dataset.csv\"\u003ECSV dataset file.\u003C\u002Fa\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cb\u003EDatabase queries \u003C\u002Fb\u003Esection provides an option to explore and visualize publicly available genomic and archeogenomic data. Users can obtain datasets from a chosen data source integrated in out graph database. Moreover, datasets can be further filtered by using our advanced query builder. Finally, produced query string is a unique identifier of the dataset and can be used as a reference to the data obtained on the web server.\u003C\u002Fp\u003E\u003Cp\u003EAll imported data appear in the \u003Cb\u003ELoaded datasets \u003C\u002Fb\u003Esections. Here users can explore metadata of the datasets, sample them or remove them.\u003C\u002Fp\u003E";
